import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import LoadingStarted from "./pages/LoadingStarted/LoadingStarted";
import StartedPage from "./pages/StartedPage/StartedPage";
import SignIn from "./pages/SignIn/SignIn";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/loadingStart" element={<LoadingStarted />} />
          <Route path="/startedPage" element={<StartedPage />} />
          <Route path='/signinPage' element={<SignIn/>}/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
